import "./App.scss";
import React from "react";
import Row from "./Row/Row";

const App = () => {
  return (
    <>
      <h2>BINGO!</h2>
      <div className="container">
        <Row />
        <Row />
        <Row />
        <Row />
        <Row />
      </div>
    </>
  );
};

export default App;
